import styles from "./ImagePlot.module.css";
import {useEffect} from "react";

const ImagePlot = () => {
  useEffect(() => {
    fetch('https://raw.githubusercontent.com/NavSous/Software-Studio-Project/data/co2.csv')
      .then(response => response.json())
      .then(data => console.log(data))
      .catch(err => console.error(err));
  },[])
  return <img className={styles.image1Icon} alt="" src="https://github.com/NavSous/Software-Studio-Project/blob/data/images/co2_30.png?raw=true" />;
};

export default ImagePlot;
